con:mockOperation.con:dispatchPath:
import com.eviware.soapui.support.XmlHolder

def holder = new XmlHolder( mockRequest.requestContent )
holder.namespaces['soapenv'] = 'http://schemas.xmlsoap.org/soap/envelope/'
holder.namespaces['urn'] = 'urn:riv:itintegration:registry:1'
holder.namespaces['urn1'] = 'urn:riv:followup:groupoutcomes:qualityreporting:GetQualityIndicatorsResponder:2'
holder.namespaces['urn2'] = 'urn:riv:followup:groupoutcomes:qualityreporting:2'

// Read request data
def logicalAddress= holder.getNodeValue('/soapenv:Envelope/soapenv:Header/urn:LogicalAddress')
def measureIdRoot = holder.getNodeValue('/soapenv:Envelope/soapenv:Body/urn1:GetQualityIndicators/urn1:measureId[1]/urn2:root')
def measureIdExtension = holder.getNodeValue('/soapenv:Envelope/soapenv:Body/urn1:GetQualityIndicators/urn1:measureId[1]/urn2:extension')
def reportingPeriodStart= holder.getNodeValue('/soapenv:Envelope/soapenv:Body/urn1:GetQualityIndicators/urn1:reportingPeriod/urn2:start')
def reportingPeriodEnd= holder.getNodeValue('/soapenv:Envelope/soapenv:Body/urn1:GetQualityIndicators/urn1:reportingPeriod/urn2:end')

// Put in requestContext for access in repsonse
requestContext.logicalAddressFromRequest = logicalAddress
requestContext.measureIdRootFromRequest = measureIdRoot
requestContext.measureIdExtensionFromRequest = measureIdExtension
requestContext.reportingPeriodStartFromRequest = reportingPeriodStart
requestContext.reportingPeriodStartFromRequest = reportingPeriodEnd

// Choose the response
// If header 'x-mock-response' is set then use it otherwise use value from 'measureId' value from request
def responseName
def responseNameFromHeader = mockRequest.requestHeaders['x-mock-response'][0]
log.info("responseName from header(x-mock-response): ${responseNameFromHeader}")

if(responseNameFromHeader){
	responseName= responseNameFromHeader
	log.info("Using responseName from header(x-mock-response): ${responseName}")
}else{
	responseName= measureIdExtension
	log.info("Using responseName from measureId): ${responseName}")
}

return responseName
